  \"Modeling Unsteady Cavitation Effects and Dynamic Loads in Cryogenic Systems Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 6,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T22:01:05.453619\",\n\t\"name\": \"modeling-unsteady-cavitation-effects-and-dynamic-loads-in-cryogenic-systems-project-995cc\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"There currently are no analytical or CFD
  tools that can reliably predict unsteady cavitation dynamics in liquid rocket cryogenic
  systems.  Analysis of cavitating cryogenic systems presents a challenge, and is
  poorly understood, because the phase change process couples with the temperature
  fluctuations in the fluid.  In particular when large scale flow unsteadiness is
  present at low-flow, off-design conditions, this coupling can lead to significant
  enhancement of vaporization and possibly lead to cavitation instabilities.  These
  large amplitude, dynamic loads can interact with other system components and cause
  severe damage.  The innovation proposed here is the development of an unsteady numerical
  framework that can predict amplitudes and frequencies of dynamic pressure loads
  in cryogenic fluids.  This innovation will address the inclusion of advanced unsteady
  cavitation models, validation for pressure fluctuations in cryogenic fluids, and
  development of unsteady boundary conditions for coupling the turbopump to other
  system components.  An experimental program will be set up in the Phase II effort
  to obtain unsteady flow data for code validation.  The resulting product, a specialized
  version of the multi-element unstructured CRUNCH CFD code, will be a well-validated
  and reliable analysis tool that can be used to predict unsteady, off-design performance
  of liquid rocket turbopumps. \",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
